import { Link } from "react-router-dom";
import React from "react";
import Wdata from "./WatchData";
import Navbar from "./Navbar";

const SCard = () => {
  return (
    <>
      <Navbar />
      {Wdata.map((product) => (
        <Link
          to={
            "/collection/" +
            product.id +
            "/" +
            product.title +
            "/" +
            product.price +
            "/" +
            product.imgsrc
          }
        >
          <p> {product.title} </p>
        </Link>
      ))}
    </>
  );
};

export default SCard;
